import { default as React } from 'react';

import * as Routes from '../../routes';

import './extra.scss';

import { Blog } from '../../components'

const InfoPage = () => {
	return (
		<div className="info">
			<div className="info__title">
				<h1>Info</h1>
				<p>
					We willen jullie ook tonen wat er nog mogelijk is met jullie RaspberryPi.
					De Mogelijkheden zijn eindeloos en je kan er zeer creatief mee omgaan.
					Met deze voorbeelden kunnen we je al eens ontdekken wat je kan ontwikkelen.
				</p>
			</div>
			<div className="info__blogs">
				<Blog link='https://pimylifeup.com/raspberry-pi-mosquitto-mqtt-server/' title='Installing the Mosquitto MQTT Server to the Raspberry Pi' context='In this project, you will be learning how to set up your Raspberry Pi as an MQTT broker. We achieve this by installing the free and open-source Mosquitto software. Mosquitto allows our Raspberry Pi to act as an MQTT server without draining its limited resources.' />
			</div>
		</div>
	);
};

export default InfoPage;
